INSERT INTO `news` (`ID`, `Headline`, `Text`, `UserID`, `Timestamp`, `Visible`) VALUES
(1, NULL, 'Welcome back to the /v/GAs: here''s to another year of chaotic organisation and being inches away from catastrophic disaster at all time.', '', '2012-10-25 00:00:00', 1),
(2, NULL, 'We''ve added 9 new <a href="/categories">categories</a>: go vote on them so we can tell which ones you like.', '', '2012-11-13 11:47:00', 1),
(3, NULL, 'Video submission is now open! Check out the <a href="/videos">videos</a> page for details.', '', '2012-11-20 00:00:00', 1),
(4, NULL, 'We''ve also brought the <a href="https://docs.google.com/document/d/1X0AW508HRznYLbdEHhSpOsuxlopwv9bkrKArqPHnMrY/edit">FAQ</a> page online; it covers many of the complaints people had about last year.', '', '2012-11-20 00:01:00', 1),
(6, NULL, 'Nominations are now closed. In total, we received over 13,000 nominations. Thanks for all your input.', '', '2012-12-29 00:00:00', 1),
(7, NULL, 'Nominees have been finalised and voting will open on January 1st. See the <a href="/voting">voting page</a> for more information.', '', '2012-12-30 00:00:00', 1),
(8, NULL, '<a href="/voting">Voting is now open!</a> It will remain open for about 2 weeks.', '', '2013-01-01 00:00:00', 1),
(9, NULL, 'Voting has now closed. In the next few days we''ll go through the results to find the winners and step up work on the main ceremony - estimates at this time for the stream are mid-to-late February.', '', '2013-01-15 00:00:00', 1),
(10, NULL, '<a href="/videos">Video submissions</a> will be closing soon.', '', '2013-01-27 00:00:00', 1),
(11, NULL, 'Video submissions are now closed.', '', '2013-02-12 00:00:00', 1),
(12, '', 'A quarter of the way into 2013 and we''ve finally confirmed a stream date: March 2nd. Check the <a href="/launcher">countdown</a> for the exact time in your timezone.', '', '2013-02-23 00:00:00', 1),
(13, NULL, 'I''m just glad it''s over.', '', '2013-03-02 00:00:00', 1);
